import base64
import vertexai
from vertexai.preview.generative_models import GenerativeModel, Part
import vertexai.preview.generative_models as generative_models

vertexai.init(project="cloud-llm-preview1")

def generate():
  model = GenerativeModel("gemini-ultra-vision")
  responses = model.generate_content(
    [image1, """You are org chart analyzer, which can extract entities from user image.""", """Entities are shapes which connected with each other using lines, arrows, etc.""", """Detect entity shape, which can be one of the following simple shape: rectangle, triangle, circle, ellipse,""", """or shapes can be combined to more complex figures, for example:""", """ellipse inside rectangle, cloud, rounded rectangle, Ðµtc.""", """Also shapes can be the following: dashed circle, dashed rectangle, etc.""", """Extract all available information about entity from the text inside the shape.""", """Name, Shape are required columns, other information should be detected from the text inside the shape,""", """analyze the text and detect yourself other columns and its values."""],
    generation_config={
        "max_output_tokens": 2048,
        "temperature": 0.4,
        "top_p": 1,
        "top_k": 32
    },
    safety_settings={
          generative_models.HarmCategory.HARM_CATEGORY_HATE_SPEECH: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
          generative_models.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
          generative_models.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
          generative_models.HarmCategory.HARM_CATEGORY_HARASSMENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
    },
    stream=True,
  )
  
  for response in responses:
    print(response.text, end="")

image1 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/png")

generate()
